import Foundation

let input = ""

extension String {
    
    func isLower() -> Bool {
        guard let scalar = UnicodeScalar(self) else { return false }
        return lower.contains(scalar)
    }
    
}

let lower = CharacterSet.lowercaseLetters
let upper = CharacterSet.uppercaseLetters

func willReact(charA: String, charB: String) -> Bool {
    return charA.uppercased() == charB.uppercased() && ((charA.isLower() && !charB.isLower()) || !charA.isLower() && charB.isLower())
}

func stripReactingChars(at index: Int, string: String) -> String {
    if index == string.count - 1 {
        return string
    } else if index < 0 {
        return stripReactingChars(at: index + 1, string: string)
    }
    
    let nextIndex = index + 1
    let asIndex = string.index(string.startIndex, offsetBy: index)
    let nextAsIndex = string.index(string.startIndex, offsetBy: nextIndex)
    let currentChar = String(string[asIndex])
    let nextChar = String(string[nextAsIndex])
    
    if willReact(charA: currentChar, charB: nextChar) {
        let sIndex = string.index(string.startIndex, offsetBy: index)
        let sNextIndex = string.index(string.startIndex, offsetBy: nextIndex)
        let new = string.replacingCharacters(in: sIndex...sNextIndex, with: "")
        return stripReactingChars(at: nextIndex, string: new)
    } else {
        return stripReactingChars(at: nextIndex, string: string)
    }
}
